import { PlusIcon } from "@heroicons/react/outline";

function Posts() {
    return (
       <div className="mx-1"> 
        {/* Post-Top*/}
        <div className="w-full sm:w-1/2  transition delay-50 flex  py-2 px-4 items-center cursor-pointer bg-gray-700 font-bold  hover:bg-cyan-400 shadow-xl">
        {/* Post-Top-Left */}
        <div><img src="./assets/images/milome.jpeg" alt="DP" className=" rounded-full h-10 w-10 m-1"/></div> 
           {/* Post-Top-Left-Words */}
            <div className="items-center ml-1 py-3"> 
                <p className="leading-3 font-semibold">Social Post</p>
                <small className="leading-3 font-light">52 mins ago</small>
            </div>

    </div>
    <div className="flex justify-center">
        {/* Button */}
        <div className="w-full sm:w-1/2 justify-center transition delay-50 flex mt-1 py-2 px-4 items-center cursor-pointer bg-gray-700 font-bold  hover:bg-cyan-400">
            <PlusIcon className="p-0.5 h-7 text-white"/>
            <p className="text-white">Social Post</p>
        </div>

    </div>
    </div>


    )
}

export default Posts;
